import './App.css';
import Header from './Component/Header';
// import NavBar from './Component/NavBar';
import 'bootstrap/dist/css/bootstrap.min.css';
import NavItem  from './Component/NavItem';

function App() {
  return (
    <div className="App">
        <BrowserRouter>
           {/* <NavBar/> */}
           <NavItem/>
            <Routes>
              <Route path= 'Get'/>

            </Routes>


        </BrowserRouter>
        <Header/>
    </div>
  );
}

export default App;
